숨이 차 가사영상을 보고 뮤비를 보러 가시기 전 알아주길 바랍니다. 먼저 세븐틴이 데뷔하기 전, 추억이 담긴 영상들이 가득한 세븐틴 유튜브 계정이 있고 여태껏 그 계정을 통해 티저, 뮤비를 공개해왔습니다. 그런데 플레디스 계정에 세븐틴, 뉴이스트 W, 프리스틴 모든 계정들을 합친다는 것에 의해서 지금 캐럿분들은 뮤비를 혐오쪽으로 신고하여 영상이 삭제되게끔 하는 중입니다. 

그러므로 다들 V앱을 통해서 뮤비를 봐주시길 바랍니다 !

I hope you know before you go to watch the music video after watching the movie. Before SEVENTEEN made her debut, she had a YouTube account full of videos of her memories. She's been showing her teaser and music videos. But by combining all the accounts of SEVENTEEN, NU'EST W and PRISTIN, CARATs are now reporting the music to the abomination side so that the video can be deleted. doing it. 

So please watch the music video through V app!

